import json
import base64


content_str = """{"ent": [{"data": {"duration": 2865, "mime": "audio/mpeg", "name": "audio5356672072808927127.m4a", "preview": "AAAAAAAAAAAAAAAAAAABAQEBAQEBBAQEAgICAgQEBAICAgIEBAQRERERMzMzZGRkXl5eXi8vL1JSUlIyMjItLS0tMDAwKysrHR0dHR8fHygoKCgjIyMmJiYmMTExCgoK", "size": 19415, "val": ""}, "tp": "AU"}], "fmt": [{"at": 0, "key": 0, "len": 1}], "txt": " "}"""


import io

   
data = json.loads(content_str)

byte_str = data['ent'][0]['data']['val']
file_name = data['ent'][0]['data']['name']

# Decode byte_str using base64

byte_str_decoded = base64.b64decode(byte_str)

# Convert byte_str to audio file
# Save audio file to disk
# Return audio file path
with open(file_name, 'wb') as f:
    f.write(byte_str_decoded)

